import React, {Component} from 'react';
import Dashboard from './components/Dashboard';
import './App.css';

class App extends Component {
    constructor() {
      this.setState({ data: {} })
    }
    render() {
        return (
            <div>
              <Dashboard cps={this.state.data}/>
            </div>
        )
    }

    state = {
        apps: []
    };

    componentDidMount() {
        fetch('http://localhost:8080/cpm/dashboard')
            .then(res => res.json())
            .then((data) => {
                this.setState({ data: data })
            })
            .catch(console.log)
    }
}

export default App;
